function Product(props) {
  const { product } = props;
  return (
    <Card key={product.slug}>
      <Link to={`/product/${product.slug}`}>
        <img src={product.image} className="card-img-top" alt={product.name} />
        <p>{product.name}</p>
      </Link>
      <p><strong>${product.price}</strong></p>
    </Card>
  );
}
export default Product;
